import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/projects">Projects</Link>
      <Link to="/bugs">Bugs</Link>
    </div>
  );
}

export default Dashboard;
